INSERT INTO `suppliers` VALUES (1,'Fish','2010-04-07 21:52:43','2010-11-21 19:39:04','fish_logo.jpg','image/jpeg',32993,'2010-11-21 19:39:03','<p><strong>Cheltenham Fish Deliveries</strong></p><p>I supply fish to ........</p><div class=\"ugdv_contextMenu\" id=\"ugdv_myMenu\" style=\"display: none; \"><ul id=\"ugdv_contextMenu\"><li id=\"ugdv_menuItem_google_docs\">Open in Google Docs Viewer</li><li id=\"ugdv_menuItem_new_tab\">Open link in new tab</li><li id=\"ugdv_menuItem_new_window\">Open link in new window</li><li id=\"ugdv_menuItem_new_incognito\">Open link in new incognito window</li><li class=\"ugdv_seperator\"></li><li id=\"ugdv_menuItem_download_file\">Download file</li><li id=\"ugdv_menuItem_copy\">Copy link address</li><li id=\"ugdv_menuItem_editpdf\">Edit PDF File on PDFescape.com</li></ul></div>',0,NULL,NULL,NULL,NULL),(2,'Fred\'s Organics','2010-06-16 19:33:17','2011-02-27 19:36:38','logoNoTrans.gif','image/gif',2190,'2010-09-30 21:05:19',NULL,0,'','boxes@fourseasonsfoods.org','<p class=\"linkdark\" style=\"font-family: \'Trebuchet MS\',Arial,Helvetica,sans-serif; font-size: 13px; font-weight: normal; color: rgb(109, 116, 98);\"><img src=\"http://www.fourseasonsfoods.org/media/deliverycorner.jpg\" alt=\"Our Logo\" /></p><p class=\"linkdark\" style=\"font-family: \'Trebuchet MS\',Arial,Helvetica,sans-serif; font-size: 13px; font-weight: normal; color: rgb(109, 116, 98);\">Our new website allows you to make regular orders online, add and remove items, either your veg boxes, or items from our organic shop like beans, eggs, flour and butter etc.<br /><br />Once you have accepted using the link below, you can add items to your order from our extensive range of organic produce, arrange to have certain weeks where you have different ammounts, set it up so that we wont deliver when youre on holiday for example, and add notes to your order if theres something you would like more of etc.</p><p class=\"linkdark\" style=\"font-family: \'Trebuchet MS\',Arial,Helvetica,sans-serif; font-size: 13px; font-weight: normal; color: rgb(109, 116, 98);\">Once we receive your order, we will invoice you either by a printed bill delivered with your order, or by email.&#160;You can then chose to pay us by cheque, cash, bank transfer or Paypal.<br /><br />We will shortly have the shop set up so that you can pay online directly, and have an online checkout system for you to use.<br /><br />If you have any questions at all, please don\'t hesitate to contact us, we are always here to help. So come on, dump the supermarket and have fresh organic produce delivered by us.</p>',NULL),(3,'Charlton Organics','2010-07-20 19:22:22','2011-03-06 09:43:00','label.gif','image/gif',10532,'2011-03-06 09:43:00','<p>Welcome to Charlton Organics</p><p>We are now supplying fresh organic eggs from our own hens</p><p>Please contact me if you would like to pay your invoice through a bank transfer. It\'s more convenient and save me money allowing me to keep the price of your produce down!</p>',0,'','charlton@fromwhereitsgrown.com','<p>Welcome to Charlton Organics Online ordering system. If you accept this invitation you will be able to update your order online and add extra products from our ever expanding range.</p><p>Payments are still made in the usual way</p>','<p>Thanks for shopping with us</p><p>Tom &amp; Clare<a title=\"Toms Organics\" href=\"toms-organics.fromwhereitsgrown.com\"><br />Toms Organics</a><a href=\"mailto:tom@tomhowlett.com\">tom@tomsorganics.com</a><a title=\"Toms Organics\" href=\"toms-organics.fromwhereitsgrown.com\"></a>01242 523607<a title=\"Toms Organics\" href=\"toms-organics.fromwhereitsgrown.com\"></a></p>'),(4,'Charlton Meats','2010-11-03 21:42:30','2011-01-28 23:44:02','chain_arrow_right.jpg','image/jpeg',3346,'2011-01-28 23:44:02','<div class=\"ugdv_contextMenu\" id=\"ugdv_myMenu\" style=\"display: none; \"><ul id=\"ugdv_contextMenu\"><li id=\"ugdv_menuItem_google_docs\">Open in Google Docs Viewer</li><li id=\"ugdv_menuItem_new_tab\