mp the supermarket and have fresh organic produce delivered by us.</p>','<p>Regards</p><p>Glenn &amp; Kishe Redwood</p><p><img src=\"https://lh3.googleusercontent.com/_mxlE_ZtAxPM/TXpO8mXq9XI/AAAAAAAAFSA/x35UDWcbOlI/black%20and%20white%20logo.jpg\" /></p>'),(8,'Ecoworks','2011-01-28 12:52:25','2011-02-01 13:47:20',NULL,NULL,NULL,NULL,'<br /><div class=\"ugdv_contextMenu\" id=\"ugdv_myMenu\" style=\"display: none;\"><ul id=\"ugdv_contextMenu\"><li id=\"ugdv_menuItem_google_docs\">Open in Google Docs Viewer</li><li id=\"ugdv_menuItem_new_tab\">Open link in new tab</li><li id=\"ugdv_menuItem_new_window\">Open link in new window</li><li id=\"ugdv_menuItem_new_incognito\">Open link in new incognito window</li><li class=\"ugdv_seperator\"></li><li id=\"ugdv_menuItem_download_file\">Download file</li><li id=\"ugdv_menuItem_copy\">Copy link address</li><li id=\"ugdv_menuItem_editpdf\">Edit PDF File on PDFescape.com</li></ul></div><div id=\"ugdv_jqContextMenu\" style=\"display: none; position: absolute; z-index: 9999;\"></div><div style=\"background-color: rgb(0, 0, 0); position: absolute; opacity: 0.2; z-index: 9998; display: none;\"></div>',0,'http://www.ecoworks.org.uk/veg-box-in-nottingham/veg-box-ordering-system/',NULL,NULL,NULL),(9,'Roots','2011-02-01 09:24:52','2011-02-01 09:24:52',NULL,NULL,NULL,NULL,'<div class=\"ugdv_contextMenu\" id=\"ugdv_myMenu\" style=\"display: none; \"><ul id=\"ugdv_contextMenu\"><li id=\"ugdv_menuItem_google_docs\">Open in Google Docs Viewer</li><li id=\"ugdv_menuItem_new_tab\">Open link in new tab</li><li id=\"ugdv_menuItem_new_window\">Open link in new window</li><li id=\"ugdv_menuItem_new_incognito\">Open link in new incognito window</li><li class=\"ugdv_seperator\"></li><li id=\"ugdv_menuItem_download_file\">Download file</li><li id=\"ugdv_menuItem_copy\">Copy link address</li><li id=\"ugdv_menuItem_editpdf\">Edit PDF File on PDFescape.com</li></ul></div><div id=\"ugdv_jqContextMenu\" style=\"display: none; position: absolute; z-index: 9999; \"></div><div style=\"background-color: rgb(0, 0, 0); position: absolute; opacity: 0.2; z-index: 9998; display: none; \"></div>',0,'',NULL,NULL,NULL),(10,'Plowright Organic','2011-03-06 20:49:09','2011-03-09 11:52:21','plowright.jpg','image/jpeg',40508,'2011-03-06 20:49:09',NULL,1,'http://plowrightorganic.co.uk/order_online.php','info@plowrightorganic.co.uk','<p>Welcome to Plowright Organic!</p><p>Once you have accepted this invitation by clicking on the link below, you will be invited to create a password to gain access to our online ordering system.</p><p>You will be able to make a regular vegbox order and add extra vegetables, fruit, eggs or bread week by week. </p><p>If you would like to create your own vegbox from the extras menu please feel free to do so.&#160; The minimum order for this type of vegbox is £8.90.</p><p>If you have any questions please do not hesitate to contact us.&#160; Richard\'s mobile number is 07977910624.&#160; </p><p>Thank you.</p>',NULL);
